var tabLinks=new Array();var contentDivs=new Array();function init(){var b=document.getElementById("tabs").childNodes;console.log(b);for(var a=0;a<b.length;a++){if(b[a].nodeName=="LI"){var d=getFirstChildWithTagName(b[a],"A");var c=getHash(d.getAttribute("href"));tabLinks[c]=d;contentDivs[c]=document.getElementById(c)}}var a=0;for(var c in tabLinks){tabLinks[c].onclick=showTab;tabLinks[c].onfocus=function(){this.blur()};if(a==0){tabLinks[c].className="active"}a++}var a=0;for(var c in contentDivs){if(a!=0){console.log(contentDivs[c]);contentDivs[c].className="content hide"}a++}}function showTab(){var a=getHash(this.getAttribute("href"));for(var b in contentDivs){if(b==a){tabLinks[b].className="active";contentDivs[b].className="content"}else{tabLinks[b].className="";contentDivs[b].className="content hide"}}return false}function getFirstChildWithTagName(c,b){for(var a=0;a<c.childNodes.length;a++){if(c.childNodes[a].nodeName==b){return c.childNodes[a]}}}function getHash(b){var a=b.lastIndexOf("#");return b.substring(a+1)}function toggle(b){b=document.getElementById(b);if(b.style&&b.style.display){var a=b.style.display}else{if(b.currentStyle){var a=b.currentStyle.display}else{if(window.getComputedStyle){var a=document.defaultView.getComputedStyle(b,null).getPropertyValue("display")}}}b.style.display=a=="block"?"none":"block";return false};